import React from "react";
import {Buttons, SingleDropDown, SearchBar} from ".."
import "../../.././assets/index.css";
import { NavLink } from "react-router-dom";

const Header = ({authenticated}) =>{

    return (
        <div className="header">
            <div className="header-top">
                <div className="header-top_logo">
                    <p>Bear<span>Bulls</span></p>
                </div>

                <div className="header-top_left">
                    <div>   
                    <NavLink to="/register">
                        {!authenticated &&<Buttons value = "Sign Up"/>}
                    </NavLink>
                    </div>
                    <div>
                        <NavLink to="/login">
                        {!authenticated &&
                            <Buttons value = "Sign In"/>}
                        </NavLink>
                    </div>
                    <div>
                        <NavLink to="/searchUser">
                        {authenticated &&
                            <Buttons value = "Search"/>}
                        </NavLink>
                    </div>
                    <div>
                        <NavLink to="/searchUser">
                        {authenticated &&
                            <Buttons value = "Search"/>}
                        </NavLink>
                    </div>

                    <div>
                        {authenticated &&
                        <SingleDropDown item1="View profile" item2="Logout" href1="/profile" />}
                    </div>
                </div>

            </div>
        </div>
    );
}

export default Header;
